def _union(self, other, sort):
    """
    Specific union logic should go here. In subclasses, union behavior
    should be overwritten here rather than in `self.union`.

    Parameters
    ----------
    other : Index or array-like
    sort : False or None, default False
        Whether to sort the resulting index.

        * False : do not sort the result.
        * None : sort the result, except when `self` and `other` are equal
          or when the values cannot be compared.

    Returns
    -------
    Index
    """
    if not len(other) or self.equals(other):
        return self._get_reconciled_name_object(other)
    if not len(self):
        return other._get_reconciled_name_object(self)
    if is_period_dtype(self) or is_datetime64tz_dtype(self):
        lvals = self._ndarray_values
    else:
        lvals = self._values
    if is_period_dtype(other) or is_datetime64tz_dtype(other):
        rvals = other._ndarray_values
    else:
        rvals = other._values
    if sort is None and self.is_monotonic and other.is_monotonic:
        try:
            result = self._outer_indexer(lvals, rvals)[0]
        except TypeError:
            result = list(lvals)
            value_set = set(lvals)
            result.extend([x for x in rvals if x not in value_set])
    else:
        if self.is_unique:
            indexer = self.get_indexer(other)
            indexer = (indexer == -1).nonzero()[0]
        else:
            indexer = algos.unique1d(self.get_indexer_non_unique(other)[1])
        if len(indexer) > 0:
            other_diff = algos.take_nd(rvals, indexer, allow_fill=False)
            result = concat_compat((lvals, other_diff))
        else:
            result = lvals
        if sort is None:
            try:
                result = algos.safe_sort(result)
            except TypeError as err:
                warnings.warn(f'{err}, sort order is undefined for incomparable objects', RuntimeWarning, stacklevel=3)
    return self._wrap_setop_result(other, result)

@Appender(_index_shared_docs['intersection'])
def intersection(self, other, sort=False):
    self._validate_sort_keyword(sort)
    self._assert_can_do_setop(other)
    other = ensure_index(other)
    if self.equals(other):
        return self._get_reconciled_name_object(other)
    if not is_dtype_equal(self.dtype, other.dtype):
        this = self.astype('O')
        other = other.astype('O')
        return this.intersection(other, sort=sort)
    if is_period_dtype(self):
        lvals = self._ndarray_values
    else:
        lvals = self._values
    if is_period_dtype(other):
        rvals = other._ndarray_values
    else:
        rvals = other._values
    if self.is_monotonic and other.is_monotonic:
        try:
            result = self._inner_indexer(lvals, rvals)[0]
            return self._wrap_setop_result(other, result)
        except TypeError:
            pass
    try:
        indexer = Index(rvals).get_indexer(lvals)
        indexer = indexer.take((indexer != -1).nonzero()[0])
    except (InvalidIndexError, IncompatibleFrequency):
        indexer = algos.unique1d(Index(rvals).get_indexer_non_unique(lvals)[0])
        indexer = indexer[indexer != -1]
    taken = other.take(indexer)
    if sort is None:
        taken = algos.safe_sort(taken.values)
        if self.name != other.name:
            name = None
        else:
            name = self.name
        return self._shallow_copy(taken, name=name)
    if self.name != other.name:
        taken.name = None
    return taken

def _assert_can_do_setop(self, other):
    if not is_list_like(other):
        raise TypeError('Input must be Index or array-like')
    return True

def _convert_can_do_setop(self, other):
    if not isinstance(other, Index):
        other = Index(other, name=self.name)
        result_name = self.name
    else:
        result_name = get_op_result_name(self, other)
    return (other, result_name)

@Appender(_index_shared_docs['get_loc'])
def get_loc(self, key, method=None, tolerance=None):
    if method is None:
        if tolerance is not None:
            raise ValueError('tolerance argument only valid if using pad, backfill or nearest lookups')
        try:
            return self._engine.get_loc(key)
        except KeyError:
            return self._engine.get_loc(self._maybe_cast_indexer(key))
    indexer = self.get_indexer([key], method=method, tolerance=tolerance)
    if indexer.ndim > 1 or indexer.size > 1:
        raise TypeError('get_loc requires scalar valued input')
    loc = indexer.item()
    if loc == -1:
        raise KeyError(key)
    return loc

