    """
    Specific union logic should go here. In subclasses, union behavior
    should be overwritten here rather than in `self.union`.

    Parameters
    ----------
    other : Index or array-like
    sort : False or None, default False
        Whether to sort the resulting index.

        * False : do not sort the result.
        * None : sort the result, except when `self` and `other` are equal
          or when the values cannot be compared.

    Returns
    -------
    Index
    """

    if not len(other) or self.equals(other):
        return self._get_reconciled_name_object(other)

    if not len(self):
        return other._get_reconciled_name_object(self)

    # TODO(EA): setops-refactor, clean all this up
    if is_period_dtype(self) or is_datetime64tz_dtype(self):
        lvals = self._ndarray_values
    else:
        lvals = self._values
    if is_period_dtype(other) or is_datetime64tz_dtype(other):
        rvals = other._ndarray_values
    else:
        rvals = other._values

    if sort is None and self.is_monotonic and other.is_monotonic:
        try:
            result = self._outer_indexer(lvals, rvals)[0]
        except TypeError:
            # incomparable objects
            result = list(lvals)

            # worth making this faster? a very unusual case
            value_set = set(lvals)
            result.extend([x for x in rvals if x not in value_set])
    else:
        # find indexes of things in "other" that are not in "self"
        if self.is_unique:
            indexer = self.get_indexer(other)
            indexer = (indexer == -1).nonzero()[0]
        else:
            indexer = algos.unique1d(self.get_indexer_non_unique(other)[1])

        if len(indexer) > 0:
            other_diff = algos.take_nd(rvals, indexer, allow_fill=False)
            result = concat_compat((lvals, other_diff))

        else:
            result = lvals

        if sort is None:
            try:
                result = algos.safe_sort(result)
            except TypeError as err:
                warnings.warn(
                    f"{err}, sort order is undefined for incomparable objects",
                    RuntimeWarning,
                    stacklevel=3,
                )

    # for subclasses
    return self._wrap_setop_result(other, result)

@Appender(_index_shared_docs["intersection"])
def intersection(self, other, sort=False):
    self._validate_sort_keyword(sort)
    self._assert_can_do_setop(other)
    other = ensure_index(other)

    if self.equals(other):
        return self._get_reconciled_name_object(other)

    if not is_dtype_equal(self.dtype, other.dtype):
        this = self.astype("O")
        other = other.astype("O")
        return this.intersection(other, sort=sort)

    # TODO(EA): setops-refactor, clean all this up
    if is_period_dtype(self):
        lvals = self._ndarray_values
    else:
        lvals = self._values
    if is_period_dtype(other):
        rvals = other._ndarray_values
    else:
        rvals = other._values

    if self.is_monotonic and other.is_monotonic:
        try:
            result = self._inner_indexer(lvals, rvals)[0]
            return self._wrap_setop_result(other, result)
        except TypeError:
            pass

    try:
        indexer = Index(rvals).get_indexer(lvals)
        indexer = indexer.take((indexer != -1).nonzero()[0])
    except (InvalidIndexError, IncompatibleFrequency):
        # InvalidIndexError raised by get_indexer if non-unique
        # IncompatibleFrequency raised by PeriodIndex.get_indexer
        indexer = algos.unique1d(Index(rvals).get_indexer_non_unique(lvals)[0])
        indexer = indexer[indexer != -1]

    taken = other.take(indexer)

    if sort is None:
        taken = algos.safe_sort(taken.values)
        if self.name != other.name:
            name = None
        else:
            name = self.name
        return self._shallow_copy(taken, name=name)

    if self.name != other.name:
        taken.name = None

    return taken

def _assert_can_do_setop(self, other):
    if not is_list_like(other):
        raise TypeError("Input must be Index or array-like")
    return True

def _convert_can_do_setop(self, other):
    if not isinstance(other, Index):
        other = Index(other, name=self.name)
        result_name = self.name
    else:
        result_name = get_op_result_name(self, other)
    return other, result_name

@Appender(_index_shared_docs["get_loc"])
def get_loc(self, key, method=None, tolerance=None):
    if method is None:
        if tolerance is not None:
            raise ValueError(
                "tolerance argument only valid if using pad, "
                "backfill or nearest lookups"
            )
        try:
            return self._engine.get_loc(key)
        except KeyError:
            return self._engine.get_loc(self._maybe_cast_indexer(key))
    indexer = self.get_indexer([key], method=method, tolerance=tolerance)
    if indexer.ndim > 1 or indexer.size > 1:
        raise TypeError("get_loc requires scalar valued input")
    loc = indexer.item()
    if loc == -1:
        raise KeyError(key)
    return loc

@Appender(_index_shared_docs["get_indexer"] % _index_doc_kwargs)
def get_indexer(self, target, method=None, limit=None, tolerance=None):
    method = missing.clean_reindex_fill_method(method)
    target = ensure_index(target)
    if tolerance is not None:
        tolerance = self._convert_tolerance(tolerance, target)

    # Treat boolean labels passed to a numeric index as not found. Without
    # this fix False and True would be treated as 0 and 1 respectively.
    # (GH #16877)
    if target.is_boolean() and self.is_numeric():
        return ensure_platform_int(np.repeat(-1, target.size))

    pself, ptarget = self._maybe_promote(target)
    if pself is not self or ptarget is not target:
        return pself.get_indexer(
            ptarget, method=method, limit=limit, tolerance=tolerance
        )

    if not is_dtype_equal(self.dtype, target.dtype):
        this = self.astype(object)
        target = target.astype(object)
        return this.get_indexer(
            target, method=method, limit=limit, tolerance=tolerance
        )

    if not self.is_unique:
        raise InvalidIndexError(
            "Reindexing only valid with uniquely valued Index objects"
        )

    if method == "pad" or method == "backfill":
        indexer = self._get_fill_indexer(target, method, limit, tolerance)
    elif method == "nearest":
        indexer = self._get_nearest_indexer(target, limit, tolerance)
    else:
        if tolerance is not None:
            raise ValueError(
                "tolerance argument only valid if doing pad, "
                "backfill or nearest reindexing"
            )
        if limit is not None:
            raise ValueError(
                "limit argument only valid if doing pad, "
                "backfill or nearest reindexing"
            )

        indexer = self._engine.get_indexer(target._ndarray_values)

    return ensure_platform_int(indexer)

def _convert_tolerance(self, tolerance, target):
    # override this method on subclasses
    tolerance = np.asarray(tolerance)
    if target.size != tolerance.size and tolerance.size > 1:
        raise ValueError("list-like tolerance size must match target index size")
    return tolerance

def _get_fill_indexer(self, target, method, limit=None, tolerance=None):
    if self.is_monotonic_increasing and target.is_monotonic_increasing:
        method = (
            self._engine.get_pad_indexer
            if method == "pad"
            else self._engine.get_backfill_indexer
        )
        indexer = method(target._ndarray_values, limit)
    else:
        indexer = self._get_fill_indexer_searchsorted(target, method, limit)
    if tolerance is not None:
        indexer = self._filter_indexer_tolerance(
            target._ndarray_values, indexer, tolerance
        )
    return indexer

@Appender(_index_shared_docs["_convert_scalar_indexer"])
def _convert_scalar_indexer(self, key, kind=None):
    assert kind in ["ix", "loc", "getitem", "iloc", None]

    if kind == "iloc":
        return self._validate_indexer("positional", key, kind)

    if len(self) and not isinstance(self, ABCMultiIndex):

        # we can raise here if we are definitive that this
        # is positional indexing (eg. .ix on with a float)
        # or label indexing if we are using a type able
        # to be represented in the index

        if kind in ["getitem", "ix"] and is_float(key):
            if not self.is_floating():
                return self._invalid_indexer("label", key)

        elif kind in ["loc"] and is_float(key):

            # we want to raise KeyError on string/mixed here
            # technically we *could* raise a TypeError
            # on anything but mixed though
            if self.inferred_type not in [
                "floating",
                "mixed-integer-float",
                "integer-na",
                "string",
                "unicode",
                "mixed",
            ]:
                self._invalid_indexer("label", key)

        elif kind in ["loc"] and is_integer(key):
            if not self.holds_integer():
                self._invalid_indexer("label", key)

    return key

@Appender(_index_shared_docs["_convert_slice_indexer"])
def _convert_slice_indexer(self, key: slice, kind=None):
    assert kind in ["ix", "loc", "getitem", "iloc", None]

    # validate iloc
    if kind == "iloc":
        return slice(
            self._validate_indexer("slice", key.start, kind),
            self._validate_indexer("slice", key.stop, kind),
            self._validate_indexer("slice", key.step, kind),
        )

    # potentially cast the bounds to integers
    start, stop, step = key.start, key.stop, key.step

    # figure out if this is a positional indexer
    def is_int(v):
        return v is None or is_integer(v)

    is_null_slicer = start is None and stop is None
    is_index_slice = is_int(start) and is_int(stop)
    is_positional = is_index_slice and not (
        self.is_integer() or self.is_categorical()
    )

    if kind == "getitem":
        """
        called from the getitem slicers, validate that we are in fact
        integers
        """
        if self.is_integer() or is_index_slice:
            return slice(
                self._validate_indexer("slice", key.start, kind),
                self._validate_indexer("slice", key.stop, kind),
                self._validate_indexer("slice", key.step, kind),
            )

    # convert the slice to an indexer here

    # if we are mixed and have integers
    try:
        if is_positional and self.is_mixed():
            # Validate start & stop
            if start is not None:
                self.get_loc(start)
            if stop is not None:
                self.get_loc(stop)
            is_positional = False
    except KeyError:
        if self.inferred_type in ["mixed-integer-float", "integer-na"]:
            raise

    if is_null_slicer:
        indexer = key
    elif is_positional:
        indexer = key
    else:
        indexer = self.slice_indexer(start, stop, step, kind=kind)

    return indexer

@Appender(_index_shared_docs["_convert_arr_indexer"])
def _convert_arr_indexer(self, keyarr):
    keyarr = com.asarray_tuplesafe(keyarr)
    return keyarr

@Appender(_index_shared_docs["_convert_index_indexer"])
def _convert_index_indexer(self, keyarr):
    return keyarr

@Appender(_index_shared_docs["_convert_list_indexer"])
def _convert_list_indexer(self, keyarr, kind=None):
    if (
        kind in [None, "iloc", "ix"]
        and is_integer_dtype(keyarr)
        and not self.is_floating()
        and not isinstance(keyarr, ABCPeriodIndex)
    ):

        if self.inferred_type == "mixed-integer":
            indexer = self.get_indexer(keyarr)
            if (indexer >= 0).all():
                return indexer
            # missing values are flagged as -1 by get_indexer and negative
            # indices are already converted to positive indices in the
            # above if-statement, so the negative flags are changed to
            # values outside the range of indices so as to trigger an
            # IndexError in maybe_convert_indices
            indexer[indexer < 0] = len(self)

            return maybe_convert_indices(indexer, len(self))

        elif not self.inferred_type == "integer":
            keyarr = np.where(keyarr < 0, len(self) + keyarr, keyarr)
            return keyarr

    return None

@Appender(_index_shared_docs["join"])
def join(self, other, how="left", level=None, return_indexers=False, sort=False):
    self_is_mi = isinstance(self, ABCMultiIndex)
    other_is_mi = isinstance(other, ABCMultiIndex)

    # try to figure out the join level
    # GH3662
    if level is None and (self_is_mi or other_is_mi):

        # have the same levels/names so a simple join
        if self.names == other.names:
            pass
        else:
            return self._join_multi(other, how=how, return_indexers=return_indexers)

    # join on the level
    if level is not None and (self_is_mi or other_is_mi):
        return self._join_level(
            other, level, how=how, return_indexers=return_indexers
        )

    other = ensure_index(other)

    if len(other) == 0 and how in ("left", "outer"):
        join_index = self._shallow_copy()
        if return_indexers:
            rindexer = np.repeat(-1, len(join_index))
            return join_index, None, rindexer
        else:
            return join_index

    if len(self) == 0 and how in ("right", "outer"):
        join_index = other._shallow_copy()
        if return_indexers:
            lindexer = np.repeat(-1, len(join_index))
            return join_index, lindexer, None
        else:
            return join_index

    if self._join_precedence < other._join_precedence:
        how = {"right": "left", "left": "right"}.get(how, how)
        result = other.join(
            self, how=how, level=level, return_indexers=return_indexers
        )
        if return_indexers:
            x, y, z = result
            result = x, z, y
        return result

    if not is_dtype_equal(self.dtype, other.dtype):
        this = self.astype("O")
        other = other.astype("O")
        return this.join(other, how=how, return_indexers=return_indexers)

    _validate_join_method(how)

    if not self.is_unique and not other.is_unique:
        return self._join_non_unique(
            other, how=how, return_indexers=return_indexers
        )
    elif not self.is_unique or not other.is_unique:
        if self.is_monotonic and other.is_monotonic:
            return self._join_monotonic(
                other, how=how, return_indexers=return_indexers
            )
        else:
            return self._join_non_unique(
                other, how=how, return_indexers=return_indexers
            )
    elif self.is_monotonic and other.is_monotonic:
        try:
            return self._join_monotonic(
                other, how=how, return_indexers=return_indexers
            )
        except TypeError:
            pass

    if how == "left":
        join_index = self
    elif how == "right":
        join_index = other
    elif how == "inner":
        # TODO: sort=False here for backwards compat. It may
        # be better to use the sort parameter passed into join
        join_index = self.intersection(other, sort=False)
    elif how == "outer":
        # TODO: sort=True here for backwards compat. It may
        # be better to use the sort parameter passed into join
        join_index = self.union(other)

    if sort:
        join_index = join_index.sort_values()

    if return_indexers:
        if join_index is self:
            lindexer = None
        else:
            lindexer = self.get_indexer(join_index)
        if join_index is other:
            rindexer = None
        else:
            rindexer = other.get_indexer(join_index)
        return join_index, lindexer, rindexer
    else:
        return join_index

def _join_monotonic(self, other, how="left", return_indexers=False):
    if self.equals(other):
        ret_index = other if how == "right" else self
        if return_indexers:
            return ret_index, None, None
        else:
            return ret_index

    sv = self._ndarray_values
    ov = other._ndarray_values

    if self.is_unique and other.is_unique:
        # We can perform much better than the general case
        if how == "left":
            join_index = self
            lidx = None
            ridx = self._left_indexer_unique(sv, ov)
        elif how == "right":
            join_index = other
            lidx = self._left_indexer_unique(ov, sv)
            ridx = None
        elif how == "inner":
            join_index, lidx, ridx = self._inner_indexer(sv, ov)
            join_index = self._wrap_joined_index(join_index, other)
        elif how == "outer":
            join_index, lidx, ridx = self._outer_indexer(sv, ov)
            join_index = self._wrap_joined_index(join_index, other)
    else:
        if how == "left":
            join_index, lidx, ridx = self._left_indexer(sv, ov)
        elif how == "right":
            join_index, ridx, lidx = self._left_indexer(ov, sv)
        elif how == "inner":
            join_index, lidx, ridx = self._inner_indexer(sv, ov)
        elif how == "outer":
            join_index, lidx, ridx = self._outer_indexer(sv, ov)
        join_index = self._wrap_joined_index(join_index, other)

    if return_indexers:
        lidx = None if lidx is None else ensure_platform_int(lidx)
        ridx = None if ridx is None else ensure_platform_int(ridx)
        return join_index, lidx, ridx
    else:
        return join_index

def _wrap_joined_index(self, joined, other):
    name = get_op_result_name(self, other)
    return Index(joined, name=name)

@Appender(IndexOpsMixin.memory_usage.__doc__)
def memory_usage(self, deep=False):
    result = super().memory_usage(deep=deep)

    # include our engine hashtable
    result += self._engine.sizeof(deep=deep)
    return result

@Appender(_index_shared_docs["where"])
def where(self, cond, other=None):
    if other is None:
        other = self._na_value

    dtype = self.dtype
    values = self.values

    if is_bool(other) or is_bool_dtype(other):

        # bools force casting
        values = values.astype(object)
        dtype = None

    values = np.where(cond, values, other)

    if self._is_numeric_dtype and np.any(isna(values)):
        # We can't coerce to the numeric dtype of "self" (unless
        # it's float) if there are NaN values in our output.
        dtype = None

    return self._shallow_copy_with_infer(values, dtype=dtype)

@classmethod
def _try_convert_to_int_index(cls, data, copy, name, dtype):
    """
    Attempt to convert an array of data into an integer index.

    Parameters
    ----------
    data : The data to convert.
    copy : Whether to copy the data or not.
    name : The name of the index returned.

    Returns
    -------
    int_index : data converted to either an Int64Index or a
                UInt64Index

    Raises
    ------
    ValueError if the conversion was not successful.
    """

    from .numeric import Int64Index, UInt64Index

    if not is_unsigned_integer_dtype(dtype):
        # skip int64 conversion attempt if uint-like dtype is passed, as
        # this could return Int64Index when UInt64Index is what's desired
        try:
            res = data.astype("i8", copy=False)
            if (res == data).all():
                return Int64Index(res, copy=copy, name=name)
        except (OverflowError, TypeError, ValueError):
            pass

    # Conversion to int64 failed (possibly due to overflow) or was skipped,
    # so let's try now with uint64.
    try:
        res = data.astype("u8", copy=False)
        if (res == data).all():
            return UInt64Index(res, copy=copy, name=name)
    except (OverflowError, TypeError, ValueError):
        pass

    raise ValueError

