def __getitem__(self, key):
    """
    Override numpy.ndarray's __getitem__ method to work as desired.

    This function adds lists and Series as valid boolean indexers
    (ndarrays only supports ndarray with dtype=bool).

    If resulting ndim != 1, plain ndarray is returned instead of
    corresponding `Index` subclass.

    """
    # There's no custom logic to be implemented in __getslice__, so it's
    # not overloaded intentionally.
    getitem = self._data.__getitem__
    promote = self._shallow_copy

    if is_scalar(key):
        key = com.cast_scalar_indexer(key)
        return getitem(key)

    if isinstance(key, slice):
        # This case is separated from the conditional above to avoid
        # pessimization of basic indexing.
        return promote(getitem(key))

    if com.is_bool_indexer(key):
        key = np.asarray(key, dtype=bool)

    key = com.values_from_object(key)
    result = getitem(key)
    if not is_scalar(result):
        return promote(result)
    else:
        return result

def append(self, other):
    """
    Append a collection of Index options together.

    Parameters
    ----------
    other : Index or list/tuple of indices

    Returns
    -------
    appended : Index
    """

    to_concat = [self]

    if isinstance(other, (list, tuple)):
        to_concat = to_concat + list(other)
    else:
        to_concat.append(other)

    for obj in to_concat:
        if not isinstance(obj, Index):
            raise TypeError("all inputs must be Index")

    names = {obj.name for obj in to_concat}
    name = None if len(names) > 1 else self.name

    return self._concat(to_concat, name)

def _concat(self, to_concat, name):

    typs = _concat.get_dtype_kinds(to_concat)

    if len(typs) == 1:
        return self._concat_same_dtype(to_concat, name=name)
    return Index._concat_same_dtype(self, to_concat, name=name)

def putmask(self, mask, value):
    """
    Return a new Index of the values set with the mask.

    Returns
    -------
    Index

    See Also
    --------
    numpy.ndarray.putmask
    """
    values = self.values.copy()
    try:
        np.putmask(values, mask, self._convert_for_op(value))
        return self._shallow_copy(values)
    except (ValueError, TypeError) as err:
        if is_object_dtype(self):
            raise err

        # coerces to object
        return self.astype(object).putmask(mask, value)

def equals(self, other) -> bool:
    """
    Determine if two Index objects contain the same elements.

    Returns
    -------
    bool
        True if "other" is an Index and it has the same elements as calling
        index; False otherwise.
    """
    if self.is_(other):
        return True

    if not isinstance(other, Index):
        return False

    if is_object_dtype(self) and not is_object_dtype(other):
        # if other is not object, use other's logic for coercion
        return other.equals(self)

    if isinstance(other, ABCMultiIndex):
        # d-level MultiIndex can equal d-tuple Index
        if not is_object_dtype(self.dtype):
            if self.nlevels != other.nlevels:
                return False

    return array_equivalent(
        com.values_from_object(self), com.values_from_object(other)
    )

@Appender(_index_shared_docs["get_value"] % _index_doc_kwargs)
def get_value(self, series, key):

    # if we have something that is Index-like, then
    # use this, e.g. DatetimeIndex
    # Things like `Series._get_value` (via .at) pass the EA directly here.
    s = extract_array(series, extract_numpy=True)
    if isinstance(s, ExtensionArray):
        if is_scalar(key):
            # GH 20882, 21257
            # First try to convert the key to a location
            # If that fails, raise a KeyError if an integer
            # index, otherwise, see if key is an integer, and
            # try that
            try:
                iloc = self.get_loc(key)
                return s[iloc]
            except KeyError:
                if len(self) > 0 and (self.holds_integer() or self.is_boolean()):
                    raise
                elif is_integer(key):
                    return s[key]
        else:
            # if key is not a scalar, directly raise an error (the code below
            # would convert to numpy arrays and raise later any way) - GH29926
            raise InvalidIndexError(key)

    s = com.values_from_object(series)
    k = com.values_from_object(key)

    k = self._convert_scalar_indexer(k, kind="getitem")
    try:
        return self._engine.get_value(s, k, tz=getattr(series.dtype, "tz", None))
    except KeyError as e1:
        if len(self) > 0 and (self.holds_integer() or self.is_boolean()):
            raise

        try:
            return libindex.get_value_at(s, key)
        except IndexError:
            raise
        except TypeError:
            # generator/iterator-like
            if is_iterator(key):
                raise InvalidIndexError(key)
            else:
                raise e1
        except Exception:
            raise e1
    except TypeError:
        # e.g. "[False] is an invalid key"
        if is_scalar(key):
            raise IndexError(key)
        raise InvalidIndexError(key)

@Appender(_index_shared_docs["get_indexer_non_unique"] % _index_doc_kwargs)
def get_indexer_non_unique(self, target):
    target = ensure_index(target)
    pself, ptarget = self._maybe_promote(target)
    if pself is not self or ptarget is not target:
        return pself.get_indexer_non_unique(ptarget)

    if is_categorical(target):
        tgt_values = np.asarray(target)
    elif self.is_all_dates:
        tgt_values = target.asi8
    else:
        tgt_values = target._ndarray_values

    indexer, missing = self._engine.get_indexer_non_unique(tgt_values)
    return ensure_platform_int(indexer), missing

def _maybe_promote(self, other):
    # A hack, but it works

    if self.inferred_type == "date" and isinstance(other, ABCDatetimeIndex):
        return type(other)(self), other
    elif self.inferred_type == "boolean":
        if not is_object_dtype(self.dtype):
            return self.astype("object"), other.astype("object")
    return self, other

def _maybe_cast_indexer(self, key):
    """
    If we have a float key and are not a floating index, then try to cast
    to an int if equivalent.
    """

    if is_float(key) and not self.is_floating():
        try:
            ckey = int(key)
            if ckey == key:
                key = ckey
        except (OverflowError, ValueError, TypeError):
            pass
    return key

def _validate_indexer(self, form, key, kind):
    """
    If we are positional indexer, validate that we have appropriate
    typed bounds must be an integer.
    """
    assert kind in ["ix", "loc", "getitem", "iloc"]

    if key is None:
        pass
    elif is_integer(key):
        pass
    elif kind in ["iloc", "getitem"]:
        self._invalid_indexer(form, key)
    return key

@Appender(_index_shared_docs["_maybe_cast_slice_bound"])
def _maybe_cast_slice_bound(self, label, side, kind):
    assert kind in ["ix", "loc", "getitem", None]

    # We are a plain index here (sub-class override this method if they
    # wish to have special treatment for floats/ints, e.g. Float64Index and
    # datetimelike Indexes
    # reject them
    if is_float(label):
        if not (kind in ["ix"] and (self.holds_integer() or self.is_floating())):
            self._invalid_indexer("slice", label)

    # we are trying to find integer bounds on a non-integer based index
    # this is rejected (generally .loc gets you here)
    elif is_integer(label):
        self._invalid_indexer("slice", label)

    return label

def _searchsorted_monotonic(self, label, side="left"):
    if self.is_monotonic_increasing:
        return self.searchsorted(label, side=side)
    elif self.is_monotonic_decreasing:
        # np.searchsorted expects ascending sort order, have to reverse
        # everything for it to work (element ordering, search side and
        # resulting value).
        pos = self[::-1].searchsorted(
            label, side="right" if side == "left" else "left"
        )
        return len(self) - pos

    raise ValueError("index must be monotonic increasing or decreasing")

def get_slice_bound(self, label, side, kind):
    """
    Calculate slice bound that corresponds to given label.

    Returns leftmost (one-past-the-rightmost if ``side=='right'``) position
    of given label.

    Parameters
    ----------
    label : object
    side : {'left', 'right'}
    kind : {'ix', 'loc', 'getitem'}

    Returns
    -------
    int
        Index of label.
    """
    assert kind in ["ix", "loc", "getitem", None]

    if side not in ("left", "right"):
        raise ValueError(
            f"Invalid value for side kwarg, must be either"
            f" 'left' or 'right': {side}"
        )

    original_label = label

    # For datetime indices label may be a string that has to be converted
    # to datetime boundary according to its resolution.
    label = self._maybe_cast_slice_bound(label, side, kind)

    # we need to look up the label
    try:
        slc = self.get_loc(label)
    except KeyError as err:
        try:
            return self._searchsorted_monotonic(label, side)
        except ValueError:
            # raise the original KeyError
            raise err

    if isinstance(slc, np.ndarray):
        # get_loc may return a boolean array or an array of indices, which
        # is OK as long as they are representable by a slice.
        if is_bool_dtype(slc):
            slc = lib.maybe_booleans_to_slice(slc.view("u1"))
        else:
            slc = lib.maybe_indices_to_slice(slc.astype("i8"), len(self))
        if isinstance(slc, np.ndarray):
            raise KeyError(
                f"Cannot get {side} slice bound for non-unique "
                f"label: {repr(original_label)}"
            )

    if isinstance(slc, slice):
        if side == "left":
            return slc.start
        else:
            return slc.stop
    else:
        if side == "right":
            return slc + 1
        else:
            return slc

@classmethod
def _add_numeric_methods_unary(cls):
    """
    Add in numeric unary methods.
    """

    def _make_evaluate_unary(op, opstr):
        def _evaluate_numeric_unary(self):

            attrs = self._get_attributes_dict()
            return Index(op(self.values), **attrs)

        _evaluate_numeric_unary.__name__ = opstr
        return _evaluate_numeric_unary

    cls.__neg__ = _make_evaluate_unary(operator.neg, "__neg__")
    cls.__pos__ = _make_evaluate_unary(operator.pos, "__pos__")
    cls.__abs__ = _make_evaluate_unary(np.abs, "__abs__")
    cls.__inv__ = _make_evaluate_unary(lambda x: -x, "__inv__")

@classmethod
def _add_numeric_methods(cls):
    cls._add_numeric_methods_unary()
    cls._add_numeric_methods_binary()

def _get_leaf_sorter(labels):
    """
    Returns sorter for the inner most level while preserving the
    order of higher levels.
    """
    if labels[0].size == 0:
        return np.empty(0, dtype="int64")

    if len(labels) == 1:
        lab = ensure_int64(labels[0])
        sorter, _ = libalgos.groupsort_indexer(lab, 1 + lab.max())
        return sorter

    # find indexers of beginning of each set of
    # same-key labels w.r.t all but last level
    tic = labels[0][:-1] != labels[0][1:]
    for lab in labels[1:-1]:
        tic |= lab[:-1] != lab[1:]

    starts = np.hstack(([True], tic, [True])).nonzero()[0]
    lab = ensure_int64(labels[-1])
    return lib.get_level_sorter(lab, ensure_int64(starts))

def _make_evaluate_unary(op, opstr):
    def _evaluate_numeric_unary(self):

        attrs = self._get_attributes_dict()
        return Index(op(self.values), **attrs)

    _evaluate_numeric_unary.__name__ = opstr
    return _evaluate_numeric_unary

def _make_logical_function(name, desc, f):
    @Substitution(outname=name, desc=desc)
    @Appender(_index_shared_docs["index_" + name])
    @Appender(_doc)
    def logical_func(self, *args, **kwargs):
        result = f(self.values)
        if (
            isinstance(result, (np.ndarray, ABCSeries, Index))
            and result.ndim == 0
        ):
            # return NumPy type
            return result.dtype.type(result.item())
        else:  # pragma: no cover
            return result

    logical_func.__name__ = name
    return logical_func

def _evaluate_numeric_unary(self):

    attrs = self._get_attributes_dict()
    return Index(op(self.values), **attrs)

